import pandas as pd
import numpy as np
from sklearn.model_selection import train_test_split
from sklearn.linear_model import LogisticRegression
from sklearn.metrics import accuracy_score
import matplotlib.pyplot as plt

"""## Load the dataset into a DataFrame (assuming df is the name of the DataFrame)

## Q1) Drop rows where AssessedValue is greater than 1 million USD
"""

df = df[df['AssessedValue'] <= 1000000]

"""## Q2) Count and drop rows with missing values"""

missing_rows = df.isnull().sum().sum()
df = df.dropna()

"""## Q3) Check column types"""

print(df.info())

"""## Q4) Count unique values in the Town column"""

unique_towns = df['Town'].nunique()

"""## Q5) Create dummy variables for Town column"""

tmp = pd.get_dummies(df['Town'])

"""## Q6) Concatenate AssessedValue, ListYear, and tmp DataFrames into X"""

mean_assessed_value = df['AssessedValue'].mean()
df['Target'] = np.where(df['AssessedValue'] > mean_assessed_value, 1, 0)
X = pd.concat([df[['ListYear']], tmp], axis=1)
y = df['Target']

"""## Q7) Subset SaleAmount to y"""

y = df['Target']

"""## Q8) Convert X and y to numpy arrays and split the data"""

X = X.values
y = y.values
X_train, X_test, y_train, y_test = train_test_split(X, y, test_size=0.2, random_state=3091683)

"""## Q9) Fit a logistic regression model and calculate accuracy"""

model = LogisticRegression()
model.fit(X_train, y_train)
y_train_pred = model.predict(X_train)
y_test_pred = model.predict(X_test)
accuracy_train = accuracy_score(y_train, y_train_pred)
accuracy_test = accuracy_score(y_test, y_test_pred)
print("Accuracy (Train):", accuracy_train)
print("Accuracy (Test):", accuracy_test)

"""## Q10) Make scatterplot of actual vs. predicted values with log axis"""

plt.figure(figsize=(10, 6))
plt.scatter(y_train, y_train_pred, label='Train', marker='o')
plt.scatter(y_test, y_test_pred, label='Test', marker='x')
plt.xlabel('Actual Values')
plt.ylabel('Predicted Values')
plt.title('Actual vs. Predicted Values')
plt.legend()
plt.show()



